import React, { useState } from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { Removetemplate, Addtemplate } from '../../redux/Action';

export default function Template() {
  const _ = require('lodash');
  const dispatch = useDispatch();
  const templates = useSelector((state)=>state.tempbrand.template);

  const [color, setColor] = useState('');
  const [number, setNumber] = useState();

  const addData = () =>{
    const data = {
      color : color,
      number : number
    }
    dispatch(Addtemplate(data, `template.${templates.length}`))
  }

  return (
    <div>
      <h1>Template</h1>
      <label>color</label>
      <input type='text' onChange={(e)=>{setColor(e.target.value)}}></input>
      <label>number</label>
      <input type='number' onChange={(e)=>{setNumber(e.target.value)}}></input>
      <button onClick={()=>{addData()}}>Add</button>
      <ul>
        {templates.map((template, index)=>{
          return (
            <li key={index}>{`${template.color} - ${template.number}`}
            <button onClick={()=>{dispatch(Removetemplate('template',index))}}>delete</button></li>
          )
        })}
      </ul>
    </div>
  )
}
